connection.execute("UPDATE libraries
SET name = 'The Best Library',
    owner = 'My cat'
WHERE
    id = 1")
connection.execute("UPDATE books
SET name = 'Harry Potter',
    description = 'Outrageous book!'
WHERE
    id = 2")
