# Зробити по 2 SQL VIEW.
connection.execute("DROP VIEW IF EXISTS TopFiveLibrariesByAmountOfBooks")
connection.execute("CREATE VIEW TopFiveLibrariesByAmountOfBooks AS
SELECT libraries.name AS 'Назва бібліотеки',
       COUNT(b.id) AS 'Кількість книг'
FROM libraries
         JOIN books b on libraries.id = b.library_id
GROUP BY libraries.name
ORDER BY COUNT(b.id) DESC
LIMIT 5;
")
connection.execute("DROP VIEW IF EXISTS TopSevenOfTheMostAncientBooks;")
connection.execute("CREATE VIEW TopSevenOfTheMostAncientBooks AS
SELECT *
FROM books
ORDER BY created_at
LIMIT 7")